import React from 'react';
import styled from 'styled-components';

const  Footer =  () => {

        const HeroWrapper = styled.div ` 
            background: #ccccff;
        `;

        const Equipo = styled.h1 `
            font-size: 25px;
            font-family: verdana, sans-serif;
            font-weight: 900;
            text-align: left;
        `;

    return (
    <HeroWrapper>
        <row class="col-12"> 
            <Equipo>Equipo:</Equipo>
        </row> 
    </HeroWrapper>
    )
}

export default Footer;
